import React from 'react'
import { useSongs } from './util/hooks'

const Feed = () => {
  const { songs } = useSongs()

  return songs ? (
    <>
      <ul>
        {songs.map((item, i) => (
          <li key={i}>
            <p>
              {item.name}
              {item.artist}
              {item.madeBy}
            </p>
          </li>
        ))}
      </ul>
    </>
  ) : null
}

export default Feed
